sap.ui.define([
	"sap/ui/core/mvc/Controller",
	"sap/ui/core/routing/History"
], function(Controller,History) {
	"use strict";

	return Controller.extend("ZNav.controller.V_Gap_Maintain", {

	fGoto_Target1: function (Evt) {
			//This code was generated by the layout editor.
			//This code was generated by the layout editor.
            var oHistory = History.getInstance();
			var sPreviousHash = oHistory.getPreviousHash();
			// Go one screen back if you find a Hash
         if (sPreviousHash !== undefined) {
				window.history.go(-1);
			}	// If you do not find a correct Hash, go to the Source screen using default router;
			else {
				var oRouter = sap.ui.core.UIComponent.getRouterFor(this);
				oRouter.navTo("", true);
			}
		},

       fGoTogapCreate: function () {
			//This code was generated by the layout editor.
         var oRouter = sap.ui.core.UIComponent.getRouterFor(this);
			// Tell the Router to Navigate To Route_Tar_1
        oRouter.navTo("Route_Gap_Create", {});
		},
		/**
	
	*/
        fGoTogapSelection: function () {
//This code was generated by the layout editor.
         var oRouter = sap.ui.core.UIComponent.getRouterFor(this);
			// Tell the Router to Navigate To Route_Tar_1
          oRouter.navTo("Route_Gap_Display", {});
		}
	});
});